import Api from './API'
class UserService{
    //get posts
   /* static getPosts() {
        return new Promise ((resolve,reject) => {
            axios.get(url).then((res) => {
                const data=res.data;
                resolve(data.body.email)
            })
            .catch((err)=> {
                reject(err);
            })
            
        });
    }*/
    static register(email,password){
        return Api().post('/register',
            email,
            password
        )
    }
}

UserService.register({email:'a4@gmail.com',password:'1221321'})
